【本剧第一季歌单于17年12月24日封单，第二季于19年8月20日封单，之后将不再有第一季、第二季歌曲曲目!!!增减!!!的更新】
第一季：1-139，共139首；第二季：140-271，共132首；
由于网易云曲库的不断更新，本歌单也将定时更换掉一些错误的歌曲（不影响歌曲编号），每集出现的歌曲及时间点会在简介及评论里按时间顺序排列出现（尽量一层楼列一集曲目，超出字数限制将顺延下去）。
因为部分歌曲网易曲库还未收入，会先以该歌手/本剧的其他歌曲替代占坑，方便后期歌曲更新后不打乱原有的序列顺序（这样的歌曲会在歌曲名之前加上*待替）。

Ps.
①*待替：曲库中暂无此歌，暂以该歌手/本剧其他歌曲占坑替代，直到曲库有此歌再更正；
②重复歌：在剧中出现多次，无法每次出现都收录，后面再出现时加此标签一律不会收入歌单排序；
③缺：不收入歌单；

第10,15,16,33,35,37,39,41,42,45,52,54,61,70,99,109,113,123 待更正。
第149,151,153,161,187,190,260 待更正。

